import postersample from './img/poster1.jpg'
import './poster.css';


import { createHashHistory } from 'history'



class Poster extends React.Component{

	static contextTypes = {
		router: PropTypes.object
	}

	redirectToTarget = () => {
		this.context.router.history.push('/secondpage')
	}

  render(){

    return <img className = 'poster' src = {doggo} onClick  />
